import React from 'react';


const Cabecero=()=>{
    return(
      <div className='cabecero'>
          <h2 className='cabecero__title'>Aprende algo nuevo</h2>
          <h6 className='cabecero__title2'></h6>
      </div>
    )
}

export default Cabecero;
